INSERT INTO `brand` VALUES (1,'Artic Fox','Thương hiệu Arctic Fox Cold Brew là nhà máy sản xuất cà phê cold brew với máy móc công nghệ hiện đại nhất tại Việt Nam hiện nay. Cùng với đó là đội ngũ chuyên gia về cà phê luôn tìm kiếm nguồn cà phê nguyên liệu cao cấp nhất và đạt chuẩn cà phê specialty. Arctic Fox Cold Brew hiện hoạt động tại Thái Lan, Việt Nam và Malaysia.',1),(2,'Green Bean Intertrade','Loạt cà phê nhân xanh được trồng khép kín, trải dài từ các nước ĐNA cho tới khu vực Trung-Nam Mỹ và các nước Châu Phi',1),(3,'KACC','Mặt hàng cà phê dược nhập chủ yếu từ Khánh An Coffee Company',1),(4,'Stupiducks','Các mặt hàng về cà phê được công ty Stupiducks nhập về',1);
