INSERT INTO `product` VALUES (1,'Sahara Espresso Blend','sahara-espresso-blend',4,18,4.3333,1,'Cà phê hạt rang Sahara Espresso Blend được được rang phù hợp với phương pháp pha chế Espresso, Aeropress, Moka pot, Protarfiler, Nanopresso, Cold brew, Cold drip, Vietnam Phin...','2023-09-16 13:24:14','2023-10-14 22:14:27',_binary '\0',_binary '',_binary '',NULL,2,1,3),(2,'Cà phê hạt rang Specialty Coffee - \"COFFEE JOURNEY\"','ca-phe-hat-rang-specialty-coffee-coffee-journey',4,69,0,6,'Bao gồm 6 hoặc 12 gói cà phê 100gr được sơ chế đặc biệt mang lại hương vị bùng nổ từ các nông trại nổi tiếng.','2023-09-10 20:07:54','2023-10-06 20:39:25',_binary '',NULL,_binary '',NULL,2,1,3),(3,'Costa Rica SHB EP Hacienda San Ignacio Marsellesa Anaerobic Natural','costa-rica-shb-ep-hacienda-san-ignacio-marsellesa-anaerobic-natural',4,10,0,1,'Hacienda San Ignacio được thành lập vào năm 2009, vào thời điểm đó nông trại có các giống truyền thống như; caturra và catuaí, đối mặt với những thách thức giống như nhiều trang trại cà phê khác trong khu vực, mục tiêu chính đã và đang đạt được sản lượng tốt theo cách bền vững nhằm đảm bảo có một nông trại cà phê được chuẩn bị cho tương lai, sử dụng các giống và giống lai mới cũng như đầu tư vào nghiên cứu và công nghệ . Niềm đam mê và hạnh phúc mà Hacienda San Ignacio cảm thấy xung quanh cà phê là tạo ra nhiều dự án và sáng kiến mà ngày nay cho phép cung cấp nhiều loại cà phê tuyệt vời, với hình nền đặc biệt trên mỗi túi.\n\nHacienda San Ignacio nằm ở Palmichal, Acosta, nơi cà phê là hoạt động thương mại chính. Vị trí, khí hậu và độ cao của vùng đất ảnh hưởng trực tiếp đến chất lượng cà phê.','2023-09-10 20:07:37','2023-10-12 11:05:07',_binary '\0',NULL,_binary '',NULL,2,8,3),(4,'Colombia El Paraiso Midnight Jasmine','colombia-el-paraiso-midnight-jasmine',4,13,5,1,'Nếu bạn có tò mò về cái tên có vẻ kì lạ \"Midnight Jasmine\" của hạt cà đến từ nông trại nổi tiếng El Paraiso Colombia này thì cũng đừng ngạc nhiên vì chính tụi mình khi cupping lần đầu cũng hào hứng lắm, pha lẫn sự thích thú và đặt ra nhiều câu hỏi hóc búa về cái tên này.\n\nChúng mình tin rằng hương thơm của hoa nhài, cùng quả đào chín mọng hoà quyện bùng nổ trong cốc Cà phê hạt rang Colombia El Paraiso Midnight Jasmine này sẽ khiến bạn ấn tượng mãi.','2023-09-10 20:07:29','2023-10-12 11:05:15',_binary '\0',NULL,_binary '',NULL,2,2,3),(5,'Honduras Finca Moka Whisky-Aged','honduras-finca-moka-whiskyaged',4,25,0,5,'Đổi mới và cải tiến là cần thiết trong tất cả các ngành công nghiệp bao gồm cả cà phê. Do đó, các nhà sản xuất cà phê không ngừng tìm các phương pháp mới mang tính đột phá trong canh tác và chế biến hạt cà phê, tập trung vào chất lượng cao hơn và nhận được nhiều giá trị hơn.  Các nhà sản xuất phá vỡ ranh giới có thể gặp rủi ro, thực hiện nhiều nghiên cứu và không phải cải tiến nào cũng hiệu quả, có thể mất nhiều năm thử nghiệm và sai để rồi tạo ra thứ gì đó đặc biệt, ngon và có thể nhân rộng.\n\nWhiskey barrels aged là một thành công trong nỗ lực tìm kiếm điều mới lạ trong ngành cà phê. Sử dụng thùng gỗ rượu whisky sau khi đã lấy hết rượu ra ngoài. Phần xót lại của thùng này là một lớp rượu whisky đã ngấm vào phần gỗ, thường được gọi là Devil’s Cut. Đây chính là thứ mà hạt cà phê tươi sẽ hấp thụ!\n\nQuy trình ủ cà phê trong thùng gỗ sồi là một phương pháp cái tiến và nâng cao. Nó làm nổi bật thuộc tính nội tại của giống cà phê cộng hưởng với sự phức tạp của hương vị trong quá trình lên men mà không làm hỏng cấu trúc của nó.\n\nNghe quá trình này có vẻ khá đơn giản, cho một mẻ cà phê tươi vào thùng rượu whiskey đã qua sử dụng và để thời gian cho ta kết quả. Tuy nhiên sự thật không hẳn như vậy, để có được kết quả hoàn hảo nhất, nhà sản xuất cần phải vừa cởi mở nhưng phải vừa thông minh trong việc đo lường các thông số để kiểm soát việc lên men. Giống cà phê nào phù hợp để sử dụng theo cấu hình hương vị mục tiêu, tỉ lệ phần trăm độ ẩm, loại thùng nào sẽ được sử dụng, rượu whiskey ảnh hưởng như thế nào đến lượng đường của hạt trước khi rang và thời gian ủ cà phê là bao lâu thì tối ưu?\n\nCà phê tươi có đặc tính hút ẩm, do đó rất dễ nhiễm mùi từ môi trường xung quanh. Khi chúng được ủ trong thùng, thời gian là yếu tố quan trọng cần được xác định chuẩn xác. Nếu như quá nhanh hay chưa đủ tuổi, chúng không thể hấp thụ những nốt hương vị gỗ thơm ngon, mật ong hay whiskey từ thùng gỗ. Ở mặt khác, để hạt cà phê tươi trong thùng ẩm ướt quá lâu sẽ dẫn đến mùi vị khó chịu.\n\nSau khi cà phê tươi và thùng được chọn, các lô cà phê sẽ được pha trộn và cho vào thùng rượu whisky. Vỏ lụa cà phê vẫn còn trong quá trình này, nó thường được loại bỏ sau khi làm khô trong quá trình bóc vỏ trước khi cà phê được vận chuyển. Thông thường cà phê sẽ được ủ trong thùng whiskey từ 4-8 tuần và 12-18 tuần cho một số loại rất đặc biệt, điều này thường sẽ phụ thuộc vào loại cà phê đầu vào được phân loại. Khoảng thời gian này tạo nên loại cà phê phức tạp mà chúng ta có ở đây, ngọt ngào, nồng nàn và thoả mãn sâu sắc.\n\nVới sự thành công của dự án này, ngành công nghiệp chế biến cà phê tiến thêm một bước và mở ra một cảnh cửa rộng lớn hơn, tạo thêm một lối đi mới để mọi người tìm kiếm và khám phá.','2023-09-10 20:07:19','2023-09-30 14:18:56',_binary '\0',NULL,_binary '',NULL,2,7,3),(6,'Colombia Jairo Arcila Pink Bourbon Eucalyptus Honey - Exotics Cofinet','colombia-jairo-arcila-pink-bourbon-eucalyptus-honey-exotics-cofinet',4,79,0,1,'Mẫu đến từ Colombia với phương pháp sơ chế đặc biệt của nhóm Cofinet vời giống Pink Bourbon\n\nĐầu tiên là Colombia Jairo Arcila Pink Bourbon Eucalyptus Honey. Chắc các bạn còn nhớ mẫu cà phê cùng farm mang tên Jairo Arcila Cinnanmon với nốt hương Quế bùng nổ, se cay và ngọt vị mật ong. Dù bạn có thích loại cà phê lên men yếm khí với các loại thảo mộc không thì đó vẫn là một loại cà phê thực sự đặc biệt.\n\nCùng với phương pháp sơ chế này, Pink Bourbon Eucalyptus mang lại trải nghiệm tươi mới hơn với nốt hương cây bạch đàn cùng bạc hà mạnh mẽ, nghe có vẻ thú vị phải không nào.\n\nDưới đây là lời giải thích từ nhà sản xuất:\n\nChỉ những quả anh đào chín đỏ được hái bằng tay và vận chuyển đến trung tâm chế biến \"La Pradera\" trong cùng một ngày.\n\nCherry được cho vào túi Grain Pro, hàn kín để tạo môi trường yếm khí và cho vào thùng nước để ổn định nhiệt độ trong suốt quá trình lên men.\n\nChúng tôi lên men cà phê trong môi trường kỵ khí trong 8 giờ, sau đó lá bạch đàn/khuynh diệp được thêm vào và trộn nhẹ nhàng để tránh làm hỏng quả cà phê.\n\nSau 20 giờ lên men, chúng tôi đã thêm axit Tartaric để đẩy nhanh quá trình lên men và góp phần truyền hương vị khuynh diệp vào hạt cà phê.\n\nHết 48 giờ đem tách vỏ và phơi trên giàn phơi đến khi đạt độ ẩm lý tưởng 11%','2023-09-10 15:41:25','2023-09-30 14:19:10',_binary '\0',NULL,_binary '',NULL,2,2,3),(7,'Colombia Granja Paraiso 92 Gesha Nuruk','colombia-granja-paraiso-92-gesha-nuruk',4,41,0,1,'Có thể gần đây, trong cộng đồng cà phê đã biết nhiều đến các phương pháp lên men hay sơ chế cà phê độc đáo đến từ nhiều quốc gia bằng việc sử dụng các nguyên liệu tự nhiên cùng kỹ thuật tiên tiến. Từ khoá lên men Koji đang được sự quan tâm của rất nhiều người trong cộng đồng cà phê đặc sản thế giới từ người nông dân, nhà sản xuất nhà rang hay chính người tiêu dùng muốn biết về phương pháp sơ chế cà phê thú vị này.\n\nTương tự Koji đến từ Nhật Bản, Nuruk là loại chất khởi động lên men tự nhiên từ lúa mì hay ngũ cốc được làm ẩm, dùng trong sản xuất rượu Soju truyền thống tại Hàn Quốc. Mục đích của Koji và Nuruk là cơ bản giống nhau nhưng khác biệt ở thành phần, cách thức sản xuất từ đó khác nhau ở hương vị và mùi thơm ở kết quả cuối cùng. Những khác biệt này phản ảnh truyền thống sản xuất và văn hoá độc đáo của Nhật Bản và Hàn Quốc.\n\nNếu như trước đây bạn đã từng sử dụng một loại cà phê được cấy men Koji rồi thì chắc chắn không thể bỏ lỡ mẫu cà phê Gesha được cấy men Nuruk được sản xuất bởi Granja Paraiso 92 và trồng tại Colombia này.','2023-09-10 15:34:30','2023-09-30 14:21:32',_binary '\0',NULL,_binary '',NULL,2,2,3),(8,'Colombia Finca Santa Lucia Barrel-aged Strawberry','colombia-finca-santa-lucia-barrelaged-strawberry',4,48,5,1,'Finca Santa Lucia nằm ở thị trấn La Plata, ở chân đồi của Trung tâm Cordillera. Đây là một thị trấn và đô thị thuộc vùng Huila của Colombia, có dân số 57.000 người bao gồm cả khu vực nông thôn. Nó nằm cách Neiva, thủ phủ của Huila, 122 km.\n\nTrang trại nằm ở độ cao 1650 masl và tổng cộng là 6,3 ha, theo tiêu chuẩn của các trang trại cà phê Huila là trung bình đến lớn. Trong số này có 4,33 ha được trồng cà phê do bảo tồn các suối nước, các khoảnh rừng bản địa và các khu vực khó tiếp cận trong trang trại không thích hợp cho việc trồng cà phê.\n\nCác giống cà phê có 60% Castillo là dòng cà phê kháng bệnh gỉ sắt (Roya); 20% Caturra và 20% của một giống có tên Colombia, là một trong những chủng kháng bệnh gỉ sắt.\n\nFinca Santa Lucia được sở hữu và điều hành bởi Yiver Vargas Perdomo, con gái của bà là Marolling và hai con trai Cristian và Juan David. Gia đình giàu nghị lực này đã trồng cà phê được 18 năm. Gia đình tự hào về cà phê của họ và cố gắng tạo ra một sản phẩm nổi bật không chỉ về chất lượng, mà còn ở các hoạt động có trách nhiệm với xã hội và sinh thái được sử dụng để tạo ra nó. Yiver mô tả trang trại là “thiên đường dân gian” vì vẻ đẹp tự nhiên và di sản văn hóa phong phú của khu vực. Một trong những dự án của cô là chia sẻ năng lượng tích cực và lối sống thân thiện với môi trường bằng cách đưa du lịch xứ cà phê đến Finca Santa Lucia.','2023-09-10 15:30:22','2023-09-30 14:21:28',_binary '\0',NULL,_binary '',NULL,2,2,3),(9,'Robusta Chư Prông Kefir Natural','robusta-chu-prong-kefir-natural',4,16,0,8,'Chư Prông Kefir Natural là mẫu cà phê được trồng và sơ chế tại Mori Coffee Farm, nơi này không quá lớn về mặt quy mô nhưng chất lượng có thể là một trong những nơi tận tâm nhất trong những nông trại chúng mình đi qua.','2023-09-10 20:22:52','2023-09-30 14:21:22',_binary '\0',NULL,_binary '',NULL,2,5,3),(10,'Epresso House Blend - You Rock','epresso-house-blend-you-rock',4,19,0,6,'Sự pha trộn này kết hợp cà phê đặc sản của Colombia với một loại cà phê Robusta chất lượng cao của Việt Nam. Gói cà này sẽ mang đến sự \"Wow\" cho bạn và nó đang dần trở thành món pha chế phổ biến tại nhà của chúng mình, phù hợp nhất với đồ uống làm từ cà phê espresso mặc dù nó cũng thú vị với các phương pháp pha cà phê khác. Sự pha trộn này là cơ sở của sự pha trộn tùy chỉnh của chúng mình cho các khách hàng hướng tới sự mới mẻ, cần một loại cà phê mạnh mẽ, nồng nàn hơn.','2023-09-13 10:09:08','2023-09-30 14:19:50',_binary '\0',NULL,_binary '',NULL,2,5,3),(11,'Juicy Summer Collection - 3 packs','juicy-summer-collection-3-packs',4,36,0,6,'Lựa chọn siêu cool cho những chuyến đi ngày hè 2023!\n\nChắc hẳn những gói cà phê hạt trong bộ sưu tập Juicy Summer này không còn quá xa lạ với cộng đồng yêu thích cà phê đặc sản specialty nói chung và các khách hàng thân quen nói riêng.\n\nBộ sưu tập này dường như là lựa chọn không thể thiếu vào những ngày hè rực rỡ. Juicy Summer bao gồm 3 gói cà phê hạt rang đặc biệt là Orange Chiffon, Straberry Natural và Anaerobic Peachy, cả 3 đều được trồng và sơ chế tại nông trại Santa Lucia ở Colombia.\n\nCùng Travel With Coffee nhé!','2023-09-13 10:32:20','2023-09-30 14:21:17',_binary '',NULL,_binary '',NULL,2,2,3),(12,'Basic Pick Combo: Kenya AA Plus Mount Kenya & Ethiopia Oromia Buku Abel G1 Natural','basic-pick-combo:-kenya-aa-plus-mount-kenya-&-ethiopia-oromia-buku-abel-g1-natural',4,26,0,1,'Cặp sản phẩm chất lượng cao, ổn định phù hợp với người sử dụng cà phê hàng ngày với yêu cầu tiêu chuẩn cao về cà phê.\n\nKenya Washed & Ethiopia Natural đang trên bàn thử nếm, nếu bạn cần một bình cà phê ngon ổn định hàng ngày thì không thể bỏ qua 2 mẫu cà phê đến từ 2 vùng cà phê nổi tiếng Kenya & Ethiopia.\n\nMẫu Kenya nổi bật về độ chua sáng đi kèm với vị ngọt mọng nước còn Ethiopia mang đến sự ngọt ngào hơn với phương pháp sơ chế Natural cùng với các nốt hương hoa phong phú.\n\nCùng thử 2 mẫu này với các dụng cụ pha chế tại nhà có sẵn tại nhà để tìm ra nhiều sự mới mẻ hơn vì mỗi bình cà phê là khác biệt','2023-09-13 10:33:07','2023-09-30 14:21:04',_binary '',NULL,_binary '',NULL,2,3,3),(13,'ESPRESSO SIGNATURE SET - 3 packs','espresso-signature-set-3-packs',4,10,0,6,'Combo 3 gói cà phê blends đặc biệt thuộc dòng Espresso Series sẽ mang lại những shot espresso khác biệt mỗi ngày với từng nốt hương vị đặc trưng của mỗi gói. 3 mẫu cà phê được rang từ mức Medium cho tới Dark.\n\nCà phê hạt rang ESPRESSO signature SET Tổng cộng có 3 món cà phê espresso thú vị từ 3 profile hương vị đặc trưng nổi tiếng được đảm bảo nguồn gốc bới bởi đội ngũ GREEN BEAN INTERTRADE:\n\n- Red Bull Espresso Blend mức rang MEDIUM+ với acid thấp, nồng hương vị chocolate và caramel nổi trội, với body dày, creamy, ngọt hậu kéo dài, gói 250gr x 1.\n\n- Sahara Espresso Blend mức rang MEDIUM cũng là một tuỳ chọn ESPRESSO nhưng với SAHARA, người dùng sẽ cảm nhận rõ hương vị trái cây nhiệt đới, acid sáng, ngọt sâu và hương hoa ngào ngạt, gói 250gr x 1\n\n- Office Espresso Blends mức rang DARK với nốt ca cao đậm, quả ngọt, mật ong, hương vị truyền thống được cấu thành từ ROBUSTA và hàm lượng ARABICA thấp hơn cho mức acid cực thấp, dường như không chua, , gói 250gr x 1','2023-09-14 09:10:56','2023-09-30 14:22:57',_binary '',NULL,_binary '',NULL,2,1,3),(14,'Combo 3 gói cà phê thuộc dòng Country Blends Series','combo-3-goi-ca-phe-thuoc-dong-country-blends-series',4,53,0,1,'Combo 3 gói cà phê thuộc dòng Country Blends Series sẽ mang lại trải nghiệm mới lạ mỗi ngày với hương vị cà phê thuần tuý từ Colombia, Ethiopia và Kenya.\n\nCà phê hạt rang Combo 3 gói cà phê thuộc dòng Country Blends Series có 3 món cà phê thú vị từ 3 vùng trồng cà phê nổi tiếng trên thế giới:\n\n- Colombia Coffee mức rang Light+ với nốt trái cây chín nổi trội, gói 250grx 1\n\n- Ethiopia Coffee mức rang Light+ với nốt vị chua trái cây và hương hoa nhài, gói 250grx 1\n\n- Kenya Coffee mức rang Light+ với nốt hương chua sáng của các lại trái berries, gói 250grx 1','2023-09-14 12:48:27','2023-09-30 14:23:24',_binary '',NULL,_binary '',NULL,2,3,3),(15,'Colombia Huila Volcano Supremo Sc 17/18','colombia-huila-volcano-supremo-sc-17/18',4,46,0,1,'Được trồng và thu hoạch ở Huila, Colombia, nguồn gốc của loại cà phê này nằm gần núi lửa Nevado de Huila ––đất giàu khoáng chất và vi khí hậu hoàn hảo để tạo ra loại cà phê phức tạp, chất lượng cao. Các nhà sản xuất sử dụng máy xay thủ công, quay tay để tách vỏ quả cà phê và sử dụng các luống phơi cao để làm khô cà phê đều. Hạt cà phê được xử lý một cách chuyên nghiệp ở mọi công đoạn sơ chế.\n\nThe Original Origins là danh mục sản phẩm cà phê hạt rang có nguồn gốc từ những vùng nguyên liệu lớn, nổi tiếng trên thế giới. Từng loại cà phê sẽ đại diện cho mỗi vùng nói lên hương vị đặc trưng, thuần tuý và đạt giá trị sản xuất cao ở sản lượng cũng như chất lượng. Đây là những dòng cà phê rất phổ biến trên thế giới và có mặt ở hầu hết các quốc gia tiêu thụ cà phê. Từng loại cà phê trong danh mục The Original Origins sẽ được sơ chế theo phương pháp phổ biến nhất tại vùng nguyên liệu đó. Ví dụ như Kenya sẽ là Washed, Ethiopia là Natural, Việt Nam có thể là Honey, Brazil Natural, Colombia Washed,...','2023-09-15 13:29:33','2023-09-30 14:23:37',_binary '\0',NULL,_binary '',NULL,2,2,3),(16,'Colombia Bourbon Sidra Finca La Gallera','colombia-bourbon-sidra-finca-la-gallera',4,63,0,6,'Finca La Gallera nằm ở phía nam của vùng Tolima, cách thủ đô Bogota của Colombia khoảng 180 km.\n\nSidra là giống cà phê lai mới, được tạo ra từ Bourbon và Typica, là sự kết hợp đặc tính của hai giống này. Nó đã có được lượng đường đậm đặc và trọng lượng của Red Bourbon và tính axit của Typica. Tại trang trại, bạn có thể phân biệt chúng bằng cách nhìn thấy những cái cây trông mạnh mẽ, tự tin với những chiếc lá màu xanh đậm và những chùm quả anh đào chặt chẽ\n\nMô tả quá trình sơ chế\n\nQuá trình lên men cherry trong 12 giờ trước khi đưa vào máy nghiền ướt, sau đó lên men thêm 12 giờ nữa trong thùng, quá trình rửa được thực hiện sau cả hai quá trình lên men, sau cùng, hạt cà phê phải được phơi nắng trong 15 ngày.','2023-09-17 15:44:32','2023-09-30 14:23:42',_binary '\0',NULL,_binary '',NULL,2,2,3),(17,'Colombia Puerto Alegre JAVA Natural','colombia-puerto-alegre-java-natural',4,76,0,1,'Java là giống cà phê tương đối hiếm thấy, chất lượng cao ở Trung Mỹ. Chịu được các bệnh chính, với nhu cầu phân bón thấp. Sự lựa chọn tốt cho nông dân sản xuất nhỏ. Đây là giống có nguồn gốc di chuyền từ Ethiopia.\n\nJava có lịch sử canh tác lâu đời. Như tên gọi, giống này được người Hà Lan đưa trực tiếp đến đảo Java, Indonesia từ Ethiopia vào đầu thế kỷ 19.\n\nJava được mang đi khắp nơi trồng trọt thử nghiệm. Bắt đầu thử nghiệm từ giữa thế kỷ 20 ở Cameroon và đến 20 năm sau mới phát hành rộng rãi để canh tác. Hay đến năm 2016, Panama mới chính thức công nhận Java, cũng là quốc gia đầu tiên tại Trung Mỹ.\n\nChất lượng của Java được đánh giá rất cao, là đại diện thú vị được công nhận để thay thế Gesha phù hợp với những nông trại cà phê nhỏ, có khả năng chống bệnh gỉ sắt trên lá cà phê.\n\nNông trại cung cấp nhân xanh cho Stupiducks lần này là Puerto Alegre.','2023-09-17 16:17:00','2023-09-30 14:23:48',_binary '\0',NULL,_binary '',NULL,2,2,3),(18,'COLOMBIA GESHA SAN JOSE HONEY - Cup of Excellence Rank 11 Colombia','colombia-gesha-san-jose-honey-cup-of-excellence-rank-11-colombia',4,91,0,9,'Consuelo đã làm việc trong lĩnh vực cà phê 20 năm, sau khi chồng cô qua đời, cô ấy tiếp tục các dự án đổi mới cùng với cậu con trai của mình. Tại trang trại San Jose, họ trồng các giống cà phê như Gesha, Yellow Bourbon và Pink Bourbon, mong muốn cải tiến mỗi ngày về mặt cơ sở hạ tầng cũng như kiến thức trong công cuộc đổi mới phương pháp sơ chế của họ.\n\nConsuelo Maria Garcia Marin hiện đang điều hành nông trại San Jose\nLô cà phê được tham gia đấu giá tại Cup Of Excellence Colombia 2021 đạt được số điểm 87.93 và nằm trong top 11 loại cà phê được đánh giá cao trong cuộc thi.','2023-09-23 20:58:02','20