30,'Traditional Robusta Cold Brew','traditional-robusta-cold-brew',1,34,0,9,'Cà phê organic 100% hạt Robusta chất lượng cao, 0% đường\n\nTaste note: chocolate, caramel, tobaco, strong body\n\nVới 100% hạt cà phê robusta chất lượng cao tại Gia Lai, có độ rang đậm và hoàn toàn hữu cơ. Bằng phương pháp ủ lạnh chiết xuất cùng hệ thống máy móc công nghệ cao, khử khuẩn UV tạo ra cà phê đậm đặc có hương vị mượt mà sóng sánh thơm đượm hương chocolate, chút đắng nhẹ, hậu vị ngọt của các loại ngũ cốc, caramel...và độ acid rất thấp.\n\n100% hạt cà phê robusta.\n\nCà phê specialty coffee Traditional Robusta Artic Fox Cold Brew - Ready to drink được pha chế bởi Arctic Fox ngon hơn khi uống với đá, sữa hạt hoặc kết hợp với các loại nước ép trái cây khác','2023-09-24 11:06:20','2023-09-30 14:25:28',_binary '\0',NULL,_binary '',NULL,4,5,3),(31,'Fine Robusta Anaerobic Pleiku Việt Nam - C5 Coffee Farm & Roasters','fine-robusta-anaerobic-pleiku-viet-nam-c5-coffee-farm-&-roasters',4,62,0,1,'Thật tuyệt khi Coffee Store được hợp tác cùng nông trại cà phê C5. Đây là một nông trại cà phê phát triển các dòng cà phê chất lượng cao, nổi bật trong năm 2023 là các loại cà phê Liberica sơ chế tiên tiến với nhiều phương pháp khác nhau, mang lại hương vị vô cùng thú vị.\n\nKhi các bạn đặt chân C5 COFFEE, các bạn cũng đang bắt đầu một cuộc hành trình tìm hiểu và cảm xúc về nguồn gốc của những hạt cà phê thơm ngon mà C5 tự hào mang đến rồi đó. Chúng mình không chỉ đơn thuần là một quán cà phê, mà còn là người kể chuyện về cuộc hành trình từ cây cà phê đến tách cà phê thơm ngon đậm đà đó nhe !!!!\n\nChúng mình đã học hỏi và trau dồi kinh nghiệm để tìm hiểu kĩ càng về nguồn gốc, quá trình trồng trọt và chế biến của từng loại hạt cà phê, để mang đến cho các bạn những ly cà phê chất lượng nhất với sức của chúng mình. Để đảm bảo chất lượng tốt nhất, C5 đã phải “ tự cung, tự cấp” để đảm bảo rằng từng hạt cà phê đều được chăm sóc kỹ lưỡng và xử lý một cách tốt nhất.\n\nViệc lựa chọn cà phê chất lượng cao không chỉ giúp chúng mình tạo ra những thức uống ngon miệng, mà còn góp phần vào việc bảo vệ môi trường và cộng đồng sản xuất cà phê nữa. Nên là C5 chúng mình hy vọng rằng mỗi ly cà phê mà mình mang đến cho các bạn không chỉ là những tách cà phê tốt nhất mà còn là những trải nghiệm thưởng thức thú vị - một chặng đường kết nối với vùng đất xa xôi nơi những hạt cà phê được sinh ra và trưởng thành.','2023-09-24 12:09:22','2023-09-30 14:25:37',_binary '\0',NULL,_binary '',NULL,2,5,3),(32,'Fine Robusta Whisky Barrels Aged, The Limited Edition dành cho sự kiện Thailand Coffee Hub 2023','fine-robusta-whisky-barrels-aged-the-limited-edition-danh-cho-su-kien-thailand-coffee-hub-2023',4,16,0,2,'Để Mang lại tinh thần đặc biệt đến từ Việt Nam cho sự kiện Thailand Coffee Hub 2023, Stupiducks mang mẫu cà phê đã cất giữ trong kho lạnh rất lâu ra để cho ra 2 mẻ rang duy nhất vô cùng hấp dẫn mà khó có thể tìm thấy ở bất kỳ đâu. Một phần trong số đó sẽ được bày bán tại Coffee Store để mang lại trải nghiệm mới cho cộng đồng yêu cà phê specialty tại Việt Nam.\n\nMẫu cà phê lần này là Robusta đến từ Gia Lai, được sơ chế đặc biệt với hương nồng whiskey, một chút thảo mộc cùng với hơi nồng ấm của khói và vị ngọt hậu kéo dài.','2023-09-30 14:32:08',NULL,_binary '\0',NULL,_binary '',NULL,2,9,3);
